import React from 'react'
import CarCardImage from './CarCardImage'
import { Link } from 'react-router-dom'

const CarCard = (models) => {

////////////// Car Name
  const title = models.map((models) => 
      <div key={models.cars.id}>
    <h1>{models.cars.car_name}</h1>
   </div>
  );

////////////// Car Picture


  const picture = models.cars.map((models) => 

    models.cars.car_picture
  
  );







  return (

    <div  className="car_card">
      {title}

      <CarCardImage car_picture={picture}/>

      <Link to="/expand">
        <button className="primary_button">Részletek ⯈</button>
      </Link>
    </div>

  )
}

export default CarCard
